//autogenerated:yes
//nolint:revive,govet,errcheck
package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_MAV_SYS_STATUS_SENSOR_EXTENDED(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e MAV_SYS_STATUS_SENSOR_EXTENDED
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := MAV_SYS_STATUS_RECOVERY_SYSTEM.MarshalText()
		require.NoError(t, err)

		var dec MAV_SYS_STATUS_SENSOR_EXTENDED
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, MAV_SYS_STATUS_RECOVERY_SYSTEM, dec)
	})
}
